// src/pages/Contact.js
import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import bannerImage from '../assets/images/purpleBanner.png';
import '../assets/fonts/Poppins-Regular.ttf';
import '../assets/fonts/Quicksand-Regular.ttf';

const Contact = () => (
    <div>
        <Header />

        {/* Banner Section */}
        <div style={styles.banner}>
            <h1 style={styles.bannerText}>Contact</h1>
        </div>
        {/* Main Content Section */}
        <div style={styles.contentSection}>
            <h2 style={styles.title}>Get in Touch with Us!</h2>
            <p style={styles.text}>Have any questions or need assistance? We’re here to help. Fill out the form below, and we’ll get back to you as soon as possible.</p>
        </div>

        <Footer />
    </div>
    );

    const styles = {
        banner: {
            width: '100%',
            height: '220px',
            backgroundImage: `url(${bannerImage})`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
        },
        bannerText: {
            color: 'black',
            fontFamily: 'Caprasimo',
            fontSize: '56px',
        },
        contentSection: {
            background: '#F7F5EF',
            padding: '60px 160px',
            display: 'flex',
            flexDirection: 'column', // Add this line
            alignItems: 'center',    // Center align items horizontally
            textAlign: 'center',
        },
        title: {
            color: '#5A4283', 
            fontSize: 32, 
            fontFamily: 'Quicksand', 
            fontWeight: '500',
        },
        text: {
            color: 'black', 
            fontSize: 16, 
            fontFamily: 'Poppins', 
            fontWeight: '500', 
        },
    };
export default Contact;
